      <div className="lowButtonWrapper">
          <animated.div 
            onMouseEnter={() => {
                setspinEntrySave({transform:"rotateY(0deg) translate(0%,-20%) scale(1.2)"})
            }}
            onMouseLeave={() => {
                setspinEntrySave({transform:"rotateY(0deg) translate(0%,0%) scale(1)"})
            }}
            onClick={() => {
                setspinEntrySave({transform:"rotateY(0deg) translate(0%,0%) scale(1)"})
                alert("You mail layout is saved.");
            }}
