            className="saveButton buttons">
            <svg
                xmlns="http://www.w3.org/2000/svg"
                width="263.061"
                height="157.143"
                version="1.1"
                viewBox="0 0 69.601 41.577"
                >
                <defs>
                    <path id="rect839" d="M33.262 78.619H67.28V99.03H33.262z"></path>
                </defs>
                <g transform="translate(-29.34 -71.815)">
                    <rect
                    width="65.638"
                    height="37.753"
                    x="33.303"
                    y="75.64"
                    fill="#000"
                    fillOpacity="0.319"
                    strokeWidth="0.06"
                    ry="8.186"
                    ></rect>
                    <rect
                    width="65.638"
                    height="37.753"
                    x="29.34"
                    y="71.815"
                    fill="#fff"
                    fillOpacity="1"
                    strokeWidth="0.06"
                    ry="8.186"
                    ></rect>
                    <text
                    transform="translate(22.684 5.234)"
                    style={{
                        lineHeight: "1.25",
                        InkscapeFontSpecification: "'Times New Roman, Bold'",
                        fontVariantLigatures: "normal",
                        fontVariantCaps: "normal",
                        fontVariantNumeric: "normal",
                        fontVariantEastAsian: "normal",
                        whiteSpace: "pre",
                    }}
                    fill="#c10300"
                    fillOpacity="1"
                    stroke="none"
                    fontFamily="Times New Roman"
                    fontSize="14.111"
                    fontStretch="normal"
                    fontStyle="normal"
                    fontVariant="normal"
                    fontWeight="bold"
                    xmlSpace="preserve"
                    >
                    <tspan x="33.262" y="91.084">
                        <tspan>Save</tspan>
                    </tspan>
                    </text>
                    <path
                    fill="#c10300"
                    fillOpacity="1"
                    stroke="none"
                    strokeWidth="0.034"
                    d="M42.366 85.783c-.713 0-1.288.574-1.288 1.288v9.813c0 .713.575 1.287 1.288 1.287h9.873c.713 0 1.287-.574 1.287-1.287v-7.491a2.57 2.57 0 00-.243-.7l-2.662-2.683a2.35 2.35 0 00-.44-.227zm.9 1.762h6.252c.215 0 .388.232.388.521v2.54c0 .288-.173.52-.388.52h-6.252c-.215 0-.388-.232-.388-.52v-2.54c0-.289.173-.521.388-.521zm4.011 5.343a1.791 1.761 0 01.01 0 1.791 1.761 0 011.791 1.76 1.791 1.761 0 01-1.79 1.762 1.791 1.761 0 01-1.792-1.761 1.791 1.761 0 011.781-1.761z"
                    ></path>
                </g>
            </svg>
          </animated.div>
          <animated.div 
            onMouseEnter={() => {
                setspinEntrySend({transform:"rotateY(0deg) translate(0%,-20%) scale(1.2)"})
            }}
            onMouseLeave={() => {
                setspinEntrySend({transform:"rotateY(0deg) translate(0%,0%) scale(1)"})
            }}
            onClick={() => {
                setspinEntrySend({transform:"rotateY(0deg) translate(0%,0%) scale(1)"})
                handelDic({activeSend:true, activeMail:false})
            }}
            style={spinEntrySend}
            
            className="sendButton buttons">
                <svg
                    xmlns="http://www.w3.org/2000/svg"
                    width="263.061"
                    height="157.143"
                    version="1.1"
                    viewBox="0 0 69.601 41.577"
                    >
                    <defs>
                        <path id="rect839" d="M33.262 78.619H67.28V99.03H33.262z"></path>
                    </defs>
                    <g transform="translate(-29.34 -71.815)">
                        <rect
                        width="65.638"
                        height="37.753"
                        x="33.303"
                        y="75.64"
                        fill="#000"
                        fillOpacity="0.319"
                        strokeWidth="0.06"
                        ry="8.186"
                        ></rect>
                        <rect
                        width="65.638"
                        height="37.753"
                        x="29.34"
                        y="71.815"
                        fill="#fff"
                        fillOpacity="1"
                        strokeWidth="0.06"
                        ry="8.186"
                        ></rect>
                        <text
                        transform="translate(22.684 5.234)"
                        style={{
                            lineHeight: "1.25",
                            InkscapeFontSpecification: "'Times New Roman, Bold'",
                            fontVariantLigatures: "normal",
                            fontVariantCaps: "normal",
                            fontVariantNumeric: "normal",
                            fontVariantEastAsian: "normal",
                            whiteSpace: "pre",
                        }}
                        fill="#c10300"
                        fillOpacity="1"
                        stroke="none"
                        fontFamily="Times New Roman"
                        fontSize="14.111"
                        fontStretch="normal"
                        fontStyle="normal"
                        fontVariant="normal"
                        fontWeight="bold"
                        xmlSpace="preserve"
                        >
                        <tspan x="33.262" y="91.084">
                            <tspan>Send</tspan>
                        </tspan>
                        </text>
                        <path
                        fill="#c10300"
                        fillOpacity="1"
                        stroke="none"
                        strokeLinecap="butt"
                        strokeLinejoin="miter"
                        strokeOpacity="1"
                        strokeWidth="0.091"
